import React, { useEffect,useState } from 'react'
import {
    Avatar
  } from '@mui/material'
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import Typography from '@mui/material/Typography';
import { Form} from 'react-bootstrap'
import Swal from 'sweetalert2'
import { Row, Col} from 'react-bootstrap'
const { Group: FormGroup, Label: FormLabel, Control: FormControl } = Form
const style = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 600,
    bgcolor: 'background.paper',
    border: '2px solid #000',
    boxShadow: 24,
    p: 4,
  };
const PartnerModal=(props)=>{
    const { visible, onClose,title } = props
    const [closeModal,setCloseModal]=useState(visible)
    console.log("=====",visible)
    const handleCancel = () => {
        //setCloseModal(false)
        onClose()
    }
    const handleSubmit = async () => {
          Swal.fire(
            'Good job!',
            'Create Partner Success',
            'success'
          )
      }
      useEffect(() => {
        setCloseModal(visible)
      }, [visible])
    console.log("yyyy",closeModal);
    return(
        <Modal
            title="Forward operator"
            //visible={visible}
            //onCancel={() => { handleCancel() }}
            //onOk={() => handleSubmit()}
            open={closeModal}
            onClose={() => { handleCancel() }}
            aria-labelledby="modal-modal-title"
            aria-describedby="modal-modal-description"
        >
            <Box sx={style} className='text-box'>
                <Typography id="modal-modal-title" variant="h3" component="h2">
                {title}
                </Typography>
                <div className="user-img">
                    <div>
                            <Avatar
                            sx={{ width: 160, height: 160 }}
                            />
                    </div>   
                </div>
                <form onSubmit={handleSubmit}>
                    <FormGroup name="image" className="mb-3">
                        <FormLabel>Image</FormLabel>

                        <Row>
                            <Col xs={7}>
                                <FormControl type="text"/>
                            </Col>
                            <Col>
                                <FormControl type="file" />
                            </Col>
                        </Row>
                    </FormGroup>
                    <FormGroup name="partnername" className="mb-3">
                        <FormLabel>Partner name</FormLabel>
                        <FormControl type="text" />
                    </FormGroup>
                    <FormGroup className="mb-3">
                        <Form.Check type="checkbox" label="Active/Inactive" />
                    </FormGroup>
                <FormGroup className="text-center">

                    <Button className='buttonDeleteDefault'  variant="contained" onClick={() => { handleCancel() }}>Cancel</Button>
                    <Button className='buttonSuccessDefault' variant="contained" type="submit">
                        Submit
                    </Button>
                </FormGroup>
                </form>
            </Box>
        </Modal>
    )
}
export default PartnerModal
